CREATE TABLE `oa_test_ad_comment` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `ad_id` varchar(64) DEFAULT NULL COMMENT '申请id',
  `industry_typ` varchar(255) DEFAULT NULL COMMENT '行业类型',
  `typ` varchar(255) DEFAULT NULL COMMENT '类别',
  `play_content` varchar(255) DEFAULT NULL COMMENT '播出内容',
  `play_require` varchar(255) DEFAULT NULL COMMENT '播出要求',
